              marginBottom: '8px',
            }}>
              üìß Li√™n h·ªá Admin ƒë·ªÉ m·ªü kh√≥a:
            </div>
            <a 
              href={`mailto:${blockInfo.adminEmail}?subject=Y√™u c·∫ßu m·ªü kh√≥a t√†i kho·∫£n&body=Xin ch√†o Admin,%0D%0A%0D%0AT√†i kho·∫£n c·ªßa t√¥i (${form.email}) ƒë√£ b·ªã kh√≥a do ƒëƒÉng nh·∫≠p sai qu√° nhi·ªÅu l·∫ßn.%0D%0A%0D%0AVui l√≤ng h·ªó tr·ª£ m·ªü kh√≥a t√†i kho·∫£n.%0D%0A%0D%0AXin c·∫£m ∆°n!`}
              style={{
                color: '#007bff',
                textDecoration: 'none',
                fontWeight: '500',
                fontSize: '16px',
              }}
            >
              {blockInfo.adminEmail}
            </a>
          </div>
          <div style={{ 
            marginTop: '12px',
            fontSize: '14px',
            color: '#666',
          }}>
            ‚è±Ô∏è Ho·∫∑c ƒë·ª£i {blockInfo.remainingMinutes} ph√∫t ƒë·ªÉ th·ª≠ l·∫°i
